import React, { useEffect,useState } from "react"
import {useParams} from 'react-router'

function EditarUsuario(){

    const params = useParams()

    const [nombre, setNombre] = useState('')
    const [apellido, setApellido] = useState('')
    const [email, setEmail] = useState('')
    const [comentario, setComentario] = useState('')

    useEffect(()=>{
        axios.post("http://localhost5000/api/usuario/editarusuario", {idusuario: params.idusuario}).then(res =>{
            console.log(res.data[0])
            const datausuario = res.data
            setNombre (datausuario.nombre)
            setApellido (datausuario.nombre)
            setEmail (datausuario.nombre)
            setComentario (datausuario.nombre)
        })
    }, [])

    function editarUsuario(){

    }

    return(
      <div className="contenedor">
        <div classname="row">
            <h2 classname="mt-4"> Editar Usuario</h2>
            </div>
            <div classname="row">
            <div className="col-sm-6 offset-3" id="columnas">
            <div className="mb-3">
                <label htmlFor="nombre" className="form-label"> Nombre </label>
                <input type="text" className="form-control" value={nombre} onChange={(e) => {setNombre(e.target.value)}}></input>

            </div>
            <div className="mb-3">
                <label htmlFor="apellido" className="form-label"> Apellido </label>
                <input type="text" className="form-control" value={apellido} onChange={(e) => {setApellido(e.target.value)}}></input>

            </div>
            <div className="mb-3">
                <label htmlFor="email" className="form-label"> Email </label>
                <input type="text" className="form-control" value={email} onChange={(e) => {setEmail(e.target.value)}}></input>

            </div>
            <div className="mb-3">
                <label htmlFor="comentario" className="form-label"> Comentario </label>
                <input type="text" className="form-control" value={comentario} onChange={(e) => {setComentario(e.target.value)}}></input>

            </div>

            <button onClick={editarUsuario} className="btn btn-success"> Guardar Usuario</button>
        </div>
      </div>
      </div>
    )
  }

export default EditarUsuario
